import './css/Note.css';
import delIcon from './assets/delete.png';
import editIcon from './assets/edit.png';

function Note({id, text, date}) {
    return (
        <div className='note-body'>
            {text} 
            <div className='note-footer'> 
                {date}
                <input type="image" src={editIcon} alt="Submit"></input>
                <input type="image" src={delIcon} alt="Submit" style="float:right"></input>
            </div>           
        </div>
    );
}

export default Note;
